def FechaFormat(x):
    y=''
    c=0
    for i in x:
       if i==',' or i=='+':
           pass
       else:
           y=y+i
    fecha=datetime.strptime(y, '%a %d %b %Y %H:%M:%S %f')
    return fecha

def PresioDeRecargaPorIdDeOferta(off):
    presiosBase={'d':20,'b':20,'r':20,'n':10,'s':30,'e':10,'c':30}
    id=int(off[0])#valor para enumerar la oferta
    tipo=off[1].__str__()#caracter q identifica  el tipo de servicio
    result=0
    if tipo=='d':
        #default
        result=id*presiosBase[tipo]
    elif tipo=='b':
        #bono
        result=id*presiosBase[tipo]
    elif tipo=='r':
        #reserva
        result=id*presiosBase[tipo]
    elif tipo=='n':
        #nauta
        c=id*5-5
        result=c+presiosBase[tipo]
    elif tipo=='s':
        #simAndPhone
        result=id*presiosBase[tipo]
    elif tipo=='e':
        #telefoniafija
        result=id*presiosBase[tipo]
    elif tipo=='t':
        #CubacelTur
        result=id*presiosBase[tipo]
    elif tipo=='p':
        #paquetes
        if id==1:
            result=6
        elif id==2:
            result=8
        elif id==3:
            result=10
    return result

